import React from 'react'

const CreateTweet = () => {
    return (
        <div className="create-tweet">
            <textarea className="create-tweet-text" placeholder="Write something..." type="text"></textarea>
            <button type="submit">Tweet</button>
        </div>
    )
}

export default CreateTweet
